    false,nt"url": null,nt"notes": "This LCP explores the effects of private
    lands on Yukon Delta NWR resources, and provides an opportunity to discuss key refuge
    issues and ways the Service can work with private landowners to protect fish and
    wildlife resources. This LCP identifies which privately-owned lands in the Yukon
    Delta NWR contain the highest quality fish and wildlife habitats. It also lists
    options- ranging from informal cooperative agreements, to land exchanges, to selling
    lands or easements- that some landowners may wish to pursue. The LCP serves primarily
    to foster communication between the Refuge and interested landowners and to help
    identify priority areas with high resource value.",nt"license_title": "License
